insert  into `suspectcrime`(`id`,`suspect_name`,`time`,`date`,`officers`,`ticket`,`arrest`,`fine`,`ticket_price`,`arrest_price`,`fine_price`,`illegal_items`,`details`,`done_by`) values (1,'Brandon_Bennett','19:28','22/5/2009','N/a',0,0,0,'$xx.xx','x minutes','$xx.xx','N/a','Suspect responded to an Ad in the paper, and  met the victim at the 24/7 in Hampton. The victim entered the vehicle, and was taken to a warehouse near the train tracks. Two accomplices then entered the vehicle, tieing the suspect in. They then asked for info on \"Joey Robinson\". Victim offered spot in Bloods and threatened to death if not compliant\n','J.Fa.19'),(2,'Francis_Cremonesi','22:08','01/5/2009','Einstein Best, Michael Davis',0,1,0,'$xx.xx','5','$92.00','Suspect was carrying 3 grams of white powder substance','\n','A.Pappas.03'),(3,'Mel_Carter','0:13','24/5/2009','Jian Fa',1,0,0,'$20.00','x minutes','$xx.xx','N/a','Speeding (8mph over the limit)\n','J.Fa.19'),(4,'Kamato_Toyama','21:14','24/5/2009','Einschtein Best',1,0,0,'$45.00','x minutes','$xx.xx','Include details of all illegal items here...','Where: The Strip, near Ammunation\nWho: Kamato Toyama\nWhen: Sunday evening, around 2100\nHe pulled over ASAP and just ticketed him. Situation fully under control.\n','E.Best.00'),(5,'Jack Knight','18:44','24/5/2009','Zavier Smith, Jian Fa',0,1,0,'$xx.xx','10 Minutes','$xx.xx','None','Speeding, wreckless driving, evading arrest, failure to comply.\n','J.Fa.19'),(6,'William_Arnaud','18:24','25/5/2009','Zavier Smith',1,0,0,'$50.00','x minutes','$xx.xx','No','The Strip speeding camera caught him driving. Officer Smith found him stopped at The Visage Casino, infront of it where a car accident took place(the car crashed into the pound there). William was ticketed and was issued a warning.\n','Z.Smith.00'),(7,'Ryo_Osamu','20:44','25/5/2009','Zavier Smith',1,0,0,'$50','x minutes','$xx.xx','Include details of all illegal items here...','Driving a black bucaneer. Went to the dice game at Four Dragons casino. Dispatch said the cameras caught him driving 81 MPH. Pulled over near Four Dragons Casino.\n','Z.Smith.00'),(8,'Aisao_Tsukara','21:28','25/5/2009','Zavier Smith',1,0,0,'$100','x minutes','$xx.xx','Include details of all illegal items here...','Speeding in a sentinel without licenses. Pulled him over near Steakhouse.\n','Z.Smith.00'),(9,'Marcel_Carter','17:52','26/5/2009','Zavier Smith, Einschtein Best',0,1,0,'$xx.xx','10 minutes','$xx.xx','Include details of all illegal items here...','Speeding and evading in a blue club. Officer Smith and Best got him after a long chase throught the highways.\n','Z.Smith.00'),(10,'Mack_Jenkins','20:00','26/5/2009','Zavier Smith, Falco Olivers',0,1,0,'$xx.xx','60 minutes','$xx.xx','Spray can, 9mm.','Speeding multiple times, not only today but 2 or more days back. Evading and shooting at LEO multiple times as well. His friend was also included. Black male, green clothes.\n','Z.Smith.00'),(11,'Mack_Jenkins','05:00','26/5/2009','Officer Smith',0,1,0,'$xx.xx','60 minutes','$xx.xx','9mm handgun, knife.','Illegal possession of a handgun.\nEvading arrest.\nAssault.\n','J.Westbrook.36'),(12,'Chris_Holmes','18:26','27/5/2009','Jian_Fa, Ashton_Campbell',0,1,0,'$xx.xx','5 minutes','$100.00','Combat SHotgun','Carrying/Brandishing of illegal firearms, evading arrest.\n','J.Fa.19'),(13,'Johnny_Silver','20:29','31/5/2009','Jian_fa, Jeff_Ryden',0,1,0,'$xx.xx','10 minutes','$xx.xx','Uzi','Attempted murder on an LEO, illegal weapons, Evading, failure to comply\n','J.Fa.19'),(14,'Dean_Final','23:23','1/6/2009','Parry MCAllist, Hugo Riviera, Falco Olivarez',0,1,0,'$200','5','200','Paint Can solvent to remove tags','Dean Final assaulted Joseph Moretti outside the parking lot N end of the street across from 24/7. Mr Final punched Mr Morretti in the face after an altercation involving a black gentleman who fled the scene. Charges were pursued.\n','A.Pappas.03'),(15,'David_Barksdale','2:14','10/6/2009','Captain Falco Olivarez, Officer I Russel Macleod',1,1,0,'150.00','10 minutes','0.00','No.','Suspect was found in an stop and search area in the middle of the night. When me and Officer Macleod aproached the suspect he was non-cooperative. Also didnt carry an ID card on him. He gave us a name, then insulted us. We took him to the PD to get his Identity checked. Where we find out he gave us a false name.\n','F.Olivarez.03'),(16,'Vladimir_Horvat','17:47','14/6/2009','Russell Macleod',0,1,0,'','15 minutes','$500.00','Colt .45','Evading police, reckless driving, driving without a license, posession of an illegal firearm without a license.\n','R.Macleod.00'),(17,'Devante_Gore','22:49','14/6/2009','Russell Macleod',0,1,0,'$xx.xx','15 minutes','$xx.xx','-','Dangerous driving, evading capture.\n','R.Macleod.00');

